import { Image } from "react-native";

const ImagenCard=()=>{
    return (
        <View style={styles.container}>
          
          <Image source={require('./imgs/coffee1.jpeg')}/>
          <Image source={require('./imgs/central_perk_logo.jpeg')}style={{width:"45%",height:"45%", resizeMode:'contain'}} />

        </View>
      );
    };
    
export default ImagenCard();
